// ------------------ ┌∩┐(◣_◢)┌∩┐ ------------------

import React, { Component } from 'react';
import { Jumbotron } from 'reactstrap';

import "../basics.css";

//REDUX-o

// ------------------ ┌∩┐(◣_◢)┌∩┐ ------------------
class SingleDataField extends Component{
  constructor(props){
    super(props);

  };
// ----------------- '(◣_◢)' ------------------

// ------------------ '(◣_◢)' ------------------
  render(){


    if(this.props.type==="Basic"){
      return(

          <div className="container ">
              <div className="row text_center " >
                  <div className="col-lg-11 col-centered">  
                  <p style={{textAlign:"center"}}>{this.props.name}</p>
                  </div>
              </div>
              <div className="row text_center" >
                  <div className="col-lg-11 col-centered  black-font">  
                  <p style={{textAlign:"center",fontSize:"35px"}}>{this.props.value}</p>
                  </div>
              </div>
          </div>

      );
      }



      if(this.props.type==="Long"){
        return(
          <div className="container">
            <div className="row  ">
                  <div className="col-xs-3" style={{textAlign:"left", width: "220px"}}>
                    <p style={{fontSize:"27px", margin:"auto"}}>{this.props.name}</p>
                  </div>

                  <div className="col-lg-9 hideOverflow black-font" style={{textAlign:"left"}}>
                  <p style={{fontSize:"27px", margin:"auto"}}>{this.props.value}</p>  
                  </div>
            </div>
          </div>

        );
      }

      if(this.props.type==="Array"){
        const txs = this.props.value;

        console.log(txs);

        return(

          <div className="container">
            <div className="row" style={{textAlign:"center"}}>
              <div className="col col_centered" style={{textAlign:"center", margin: "auto"}}>
                  <p style={{fontSize:"24px"}}>{this.props.name}</p>
              </div>
            </div>
            {
              this.props.value.map((tx)=>{
                console.log("This ma 1 tx: ", tx);
                return (  
                  <div className="row" style={{textAlign:"center"}}>
                    <div className="col col_centered" style={{textAlign:"center", margin: "auto"}}>
                      <p style={{fontSize:"24px"}}>{tx}</p>
                    </div>
                  </div>
                )
              })
            }
          </div>

        );
      }

      if(this.props.type==="Variable" && this.props.name==="vin"){

        return(

          <div className="container">
            <div className="row" style={{textAlign:"center"}}>
              <div className="col col_centered" style={{textAlign:"center", margin: "auto"}}>
                  <p style={{fontSize:"24px"}}>{this.props.name}</p>
              </div>
            </div>
            {
              this.props.value.map((vin)=>{
                console.log(`${this.props.name} : ${vin}`);
                return (  
                  <div className="row" style={{textAlign:"center"}}>
                    <div className="col col_centered" style={{textAlign:"center", margin: "auto"}}>
                      <p style={{fontSize:"24px"}}>VIN WILL COME HERE</p>
                    </div>
                  </div>
                )
              })
            }
          </div>

        );
      }


      if(this.props.type==="Variable" && this.props.name==="vout"){

        return(

          <div className="container">
            <div className="row" style={{textAlign:"center"}}>
              <div className="col col_centered" style={{textAlign:"center", margin: "auto"}}>
                  <p style={{fontSize:"24px"}}>{this.props.name}</p>
              </div>
            </div>
            {
              this.props.value.map((tx_element)=>{
                console.log(`${this.props.name} : ${tx_element}`);
                return (  
                  <div className="row" style={{textAlign:"center"}}>
                    <div className="col col_centered" style={{textAlign:"center", margin: "auto"}}>
                      <p style={{fontSize:"24px"}}>
                      {
                          tx_element.scriptPubKey.addresses.map((tx_element_address)=>{
                            return tx_element_address;
                          })
                      }

                      </p>
                    </div>
                  </div>
                )
              })
            }
          </div>

        );
      }
  }

// ------------------° ̿ ̿'''\̵͇̿̿\з=(◕_◕)=ε/̵͇̿̿/'̿'̿ ̿ °------------------
};
// ------------------° ̿ ̿'''\̵͇̿̿\з=(◕_◕)=ε/̵͇̿̿/'̿'̿ ̿ °------------------
export default SingleDataField;
